import j0 from '../../assets/images/j1.png';
import j1 from '../../assets/images/j1.png';
import j2 from '../../assets/images/j1.png';
import j3 from '../../assets/images/j1.png';
import j4 from '../../assets/images/j1.png';
import j5 from '../../assets/images/j1.png';
import j6 from '../../assets/images/j1.png';
import j7 from '../../assets/images/j1.png';
import j8 from '../../assets/images/j1.png';
import j9 from '../../assets/images/j1.png';
  /*<img src={img03} alt="img" className="img-fluid" width="500" />;*/
import { Link } from 'react-router-dom';
import Descripcion from '../../components/Descripcion/Descripcion';

let lugar = [
  {
    tiempo: 'Rediseño de plataforma',
  },
];

export default function JuegoPage() {
  return (
    <div>
      <div className="container my-3">
        <h1 className="titulo2">Juego de mesa</h1>
        <div className="col-sm">
          <div className="lugar">
            {lugar.map((descripcion, index) => {
              return (
                <Descripcion
                  key={index}
                  texto={descripcion.texto}
                  tiempo={descripcion.tiempo}
                  precio={descripcion.precio}
                  costo={descripcion.costo}
                ></Descripcion>
              );
            })}
          </div>
        </div>












        
        </div>

       

        

      

       

        

      
    </div>
  );
}
